import React, { useState } from 'react';
import { EyeTwoTone, EyeInvisibleOutlined } from '@ant-design/icons';
import { Button, Modal, Input } from 'antd';
import 'antd/dist/reset.css';
import "./Recuperar3.css";

export const Recuperar3 = ({ isVisible, onClose, closeModal2 }) => {

    const [isModalVisible, setIsModalVisible] = React.useState(isVisible);

    React.useEffect(() => {
        setIsModalVisible(isVisible);
    }, [isVisible]);

    const [inputValue1, setInputValue1] = useState(null);
    const [inputValue2, setInputValue2] = useState(null);
    const [isPasswordVisible, setIsPasswordVisible] = useState(false);

    const closeModal3 = () => {
        setInputValue1(null);
        setInputValue2(null);
        setIsPasswordVisible(false);
        setIsModalVisible(false);
        onClose();
        closeModal2();
    };

    return (
        <>
            <Modal
                title="Recuperar Contraseña"
                centered
                open={isModalVisible}
                onCancel={closeModal3}
                footer={null}
                className='modal_recuperar3'
            >
                <div className="div">
                    <p className='text'>Ingrese su nueva contraseña</p>
                </div>

                <div className='div_input'>
                    <Input.Password placeholder="Nueva contraseña" className='input1' iconRender={(visible) => (visible ? <EyeTwoTone /> : <EyeInvisibleOutlined />)} value={inputValue1} onChange={(e) => setInputValue1(e.target.value)} visible={isPasswordVisible}/>
                    <Input.Password placeholder="Confirmar contraseña" className='input2' iconRender={(visible) => (visible ? <EyeTwoTone /> : <EyeInvisibleOutlined />)} value={inputValue2} onChange={(e) => setInputValue2(e.target.value)}/>
                </div>

                <Button className='boton_enviar'>Cambiar Contraseña</Button>
            </Modal>
        </>
    );
};

export default Recuperar3;
